    // </Router>
    <Router>
      <div>
        <Menu />
        <Route path="/" component={Accueil} />
        <Route path="/top-10-auteurs" component={TopAuteurs} />
        <Route path="/top-10-mangas" component={TopMangas} />
        <Route path="/connection" component={Connection} />
        <Route path="/test" component={ListeTests} />
        <Footer />
      </div>
    </Router>
  );
   
}

export default App;
